import React from 'react';
import './checkout.styles.scss';


const CheckoutPage = () => { 
    return (
        <div className='checkout-page'>
            <div className='checkout-header'>
                <div className='header-blocks'>
                    <span>Product</span>
                    <span>Description</span>
                    <span>Quantity</span>
                    <span>Price</span>
                    <span>Remove</span>
                </div>
            </div>

            Checkout Page
        </div>
    )
}

export default CheckoutPage
